  flex: 1 0 auto; 
  display: flex;
  align-items: flex-start;
  margin: 10px;
  padding: 10px;
  border: 4px solid #000;
`;

export const Bottom = styled.div`
  flex: 0 0 auto;
  display: flex;
  justify-content: center;
  margin: 10px;
  padding: 10px;
  border: 4px solid #000;
`;

